import React from "react";
import {FirstName,LastName} from "./App";



const Comp3 = () =>{
    return (
        <>
        <FirstName.Consumer>{(fname)=>{
            return (
                <LastName.Consumer>
                    { (lname)=>{
                        return <h1 className="head">HEY MY NAME IS {fname} {lname}</h1>
                    }}
                </LastName.Consumer>
            )
        }
        }
        </FirstName.Consumer>
        </>
    );
}

export default Comp3;
